                                      <span class="h2  font-weight-bold mb-0">
                                        {statAll.usedTotalCountAll} كوبون
                                      </span>
                                      <br />
                                      <span
                                        style={{ color: "green" }}
                                        class="h3 font-weight-bold mb-0"
                                      >
                                        {statAll.usedTotalAll} ر.س
                                      </span>
                                    </div>
                                    <div class="col-auto">
                                      <div class="icon icon-shape bg-gradient-info text-white rounded-circle shadow">
                                        <i class="ni ni-chart-bar-32"></i>
                                      </div>
                                    </div>
                                  </div>
                                </div>
                              </div>
                            </div>
                            <div class="col-xl-6 col-md-6">
                              <div
                                class="card card-stats"
                                style={{
                                  backgroundColor: "hsl(187deg 100% 42% / 36%)",
                                }}
                              >
                                <div class="card-body">
                                  <div class="row">
                                    <div class="col">
                                      <h5 class="card-title text-uppercase text-muted mb-0">
                                        الكوبونات المرسلة
                                      </h5>
                                      <span class="h2  font-weight-bold mb-0">
                                        {statAll.sentTotalCountAll} كوبون
                                      </span>
                                      <br />
                                      <span
                                        style={{ color: "green" }}
                                        class="h3 font-weight-bold mb-0"
                                      >
                                        {statAll.sentTotalAll} ر.س
                                      </span>
                                    </div>
                                    <div class="col-auto">
                                      <div class="icon icon-shape bg-gradient-info text-white rounded-circle shadow">
                                        <i class="ni ni-chart-bar-32"></i>
                                      </div>
                                    </div>
                                  </div>
                                </div>
                              </div>
                            </div>

                            <div class="col-xl-12 col-md-12">
                              <div
                                class="card card-stats"
                                style={{
                                  backgroundColor: "hsl(187deg 100% 42% / 36%)",
                                }}
                              >
                                <div class="card-body">
                                  <div class="row">
                                    <div class="col">
                                      <h5 class="card-title text-uppercase text-muted mb-0">
                                        مجموع الكوبونات
                                      </h5>
                                      <span class="h2  font-weight-bold mb-0">
                                        {statAll.usedTotalCountAll +
                                          statAll.sentTotalCountAll}{" "}
                                        كوبون
                                      </span>
                                      <br />
                                      <span
                                        style={{ color: "green" }}
                                        class="h3 font-weight-bold mb-0"
                                      >
                                        {statAll.usedTotalAll +
                                          statAll.sentTotalAll +
                                          statAll.newTotalAll}{" "}
                                        ر.س
                                      </span>
                                    </div>
                                    <div class="col-auto">
                                      <div class="icon icon-shape bg-gradient-info text-white rounded-circle shadow">
                                        <i class="ni ni-chart-bar-32"></i>
                                      </div>
                                    </div>
                                  </div>
                                </div>
                              </div>
                            </div>
                          </div>
                          <div class="col-xl-12 col-md-12">
                            <div class="">
                              <div class="card-body  rounded">
                                <div class="row">
                                  <div class="col">
                                    <h1 style={{ textAlign: "center" }}>
                                      كوبونات السنة الحالية
                                    </h1>
                                  </div>
                                </div>
                              </div>
                            </div>
                          </div>
                          <div class="row" dir="rtl">
                            <div class="col-xl-12 col-md-12 col-sm-12">
                              <div class="nav-wrapper">
                                <ul
                                  class="nav nav-pills nav-fill flex-column flex-md-row"
                                  id="tabs-icons-text"
                                  role="tablist"
                                >
                                  <li class="nav-item">
                                    <a
                                      class="nav-link mb-sm-3 mb-md-0 active"
                                      id="tabs-icons-text-1-tab"
                                      data-toggle="tab"
                                      href="#tabs-icons-text-1"
                                      role="tab"
                                      aria-controls="tabs-icons-text-1"
                                      aria-selected="true"
                                    >
                                      <i class="ni ni-cloud-upload-96 mr-2"></i>
                                      الكمية
                                    </a>
                                  </li>
                                  <li class="nav-item">
                                    <a
                                      class="nav-link mb-sm-3 mb-md-0"
                                      id="tabs-icons-text-2-tab"
                                      data-toggle="tab"
                                      href="#tabs-icons-text-2"
                                      role="tab"
                                      aria-controls="tabs-icons-text-2"
                                      aria-selected="false"
                                    >
                                      <i class="ni ni-bell-55 mr-2"></i> القيمة
                                      بالريال
                                    </a>
                                  </li>
                                </ul>
                              </div>
                              <div class="">
                                <div class="card-body">
                                  <div class="tab-content" id="myTabContent">
                                    <div
                                      class="tab-pane fade show active"
                                      id="tabs-icons-text-1"
                                      role="tabpanel"
                                      aria-labelledby="tabs-icons-text-1-tab"
                                    >
                                      <Chart
                                        type="bar"
                                        data={BarChartDataNumbers}
                                      />
                                    </div>
                                    <div
                                      class="tab-pane fade"
                                      id="tabs-icons-text-2"
                                      role="tabpanel"
                                      aria-labelledby="tabs-icons-text-2-tab"
                                    >
                                      <Chart
                                        type="bar"
                                        data={BarChartDataMoney}
                                      />
                                    </div>
                                  </div>
                                </div>
                              </div>
                            </div>
                            <div class="col-xl-12 col-md-12 col-sm-12">
                              <div class="nav-wrapper">
                                <ul
                                  class="nav nav-pills nav-fill flex-column flex-md-row"
                                  id="tabs-icons-text"
                                  role="tablist"
                                >
                                  <li class="nav-item">
                                    <a
                                      class="nav-link mb-sm-3 mb-md-0 active"
                                      id="tabs-icons-text-4-tab"
                                      data-toggle="tab"
                                      href="#tabs-icons-text-4"
                                      role="tab"
                                      aria-controls="tabs-icons-text-4"
                                      aria-selected="true"
                                    >
                                      <i class="ni ni-cloud-upload-96 mr-2"></i>
                                      الكمية
                                    </a>
                                  </li>
                                  <li class="nav-item">
                                    <a
                                      class="nav-link mb-sm-3 mb-md-0"
                                      id="tabs-icons-text-3-tab"
                                      data-toggle="tab"
                                      href="#tabs-icons-text-3"
                                      role="tab"
                                      aria-controls="tabs-icons-text-3"
                                      aria-selected="false"
                                    >
                                      <i class="ni ni-bell-55 mr-2"></i> القيمة
                                      بالريال
                                    </a>
                                  </li>
                                </ul>
                              </div>
                              <div class="">
                                <div class="card-body">
                                  <div class="tab-content" id="myTabContent">
                                    <div
                                      class="tab-pane fade show active"
                                      id="tabs-icons-text-4"
                                      role="tabpanel"
                                      aria-labelledby="tabs-icons-text-4-tab"
                                    >
                                      <Chart
                                        type="doughnut"
                                        data={PieCartDataNumbers}
                                      />
                                    </div>
                                    <div
                                      class="tab-pane fade"
                                      id="tabs-icons-text-3"
                                      role="tabpanel"
                                      aria-labelledby="tabs-icons-text-3-tab"
                                    >
                                      <Chart
                                        type="doughnut"
                                        data={PieCartDataMoney}
                                      />
                                    </div>
                                  </div>
                                </div>
                              </div>
                            </div>
                          </div>{" "}
                        </>
                      ) : (
                        ""
                      )}
                    </>
                  ) : (
                    "بيانات"
                  )}
                  {showSkeleton2 ? <Skeleton height={40} count={10} /> : ""}
                </div>

                <div class="modal-footer">
                  <button
                    type="button"
                    class="btn btn-link "
                    data-dismiss="modal"
                    style={{ float: "left" }}
                  >
                    إغلاق
                  </button>
                </div>
              </div>
            ) : modalType == "cards" ? (
              <div class="modal-content">
                <div class="modal-header">
                  <h6 class="modal-title" id="modal-title-default">
                    بطاقات المستفيد
                  </h6>
                  <button
                    type="button"
                    class="close"
                    data-dismiss="modal"
                    aria-label="Close"
                  >
                    <span aria-hidden="true">×</span>
                  </button>
                </div>

                <div class="modal-body">
                  {ModelData ? <UserCards user_id={ModelData.user_id} /> : ""}

                  {showSkeleton2 ? <Skeleton height={40} count={10} /> : ""}
                </div>
                <button
                  type="button"
                  class="btn btn-danger "
                  style={{ float: "right" }}
                  onClick={() => {
                    setmodalType("newCard");
                  }}
                >
                  بطاقة جديدة
                </button>
                <div class="modal-footer">
                  <button
                    type="button"
                    class="btn btn-link "
                    data-dismiss="modal"
                    style={{ float: "left" }}
                  >
                    إغلاق
                  </button>
                </div>
              </div>
            ) : modalType == "newCard" ? (
              <div class="modal-content">
                <div class="modal-header">
                  <h6 class="modal-title" id="modal-title-default">
                    بطاقة جديدة
                  </h6>
                  <button
                    type="button"
                    class="close"
                    data-dismiss="modal"
                    aria-label="Close"
                  >
                    <span aria-hidden="true">×</span>
                  </button>
                </div>

                <div class="modal-body">
                  {ModelData ? (
                    <NewCardForm
                      user_id={ModelData.user_id}
                      username={ModelData.Name}
                      GoBackAndTriggerMutation={GoBackAndTriggerMutation}
                    />
                  ) : (
                    ""
                  )}

                  {showSkeleton2 ? <Skeleton height={40} count={10} /> : ""}
                </div>

                <div class="modal-footer">
                  <button
                    type="button"
                    class="btn btn-link "
                    data-dismiss="modal"
                    style={{ float: "left" }}
                  >
                    إغلاق
                  </button>
                </div>
              </div>
            ) : modalType == "updateMandobe" ? (
              <div class="modal-content">
                <div class="modal-header">
                  <h6 class="modal-title" id="modal-title-default">
                    تغير المندوب
                  </h6>
                  <button
                    type="button"
                    class="close"
                    data-dismiss="modal"
                    aria-label="Close"
                  >
                    <span aria-hidden="true">×</span>
                  </button>
                </div>

                <div class="modal-body">
                  {ModelData ? (
                    <ListMandobes
                      user_id={ModelData.user_id}
                      mandobe_id={ModelData.mandobe_id}
                      setNewMandobe_id={setNewMandobe_id}
                    />
                  ) : (
                    ""
                  )}

                  {NewMandobe_id > 0 ? (
                    <button
                      type="button"
                      class="btn btn-danger "
                      data-dismiss="modal"
                      style={{ float: "right" }}
                      onClick={() => {
                        updateUserMandobe(ModelData.user_id);
                      }}
                    >
                      تحديث
                    </button>
                  ) : (
                    ""
                  )}

                  {showSkeleton2 ? <Skeleton height={40} count={10} /> : ""}
                </div>

                <div class="modal-footer">
                  <button
                    type="button"
                    class="btn btn-link "
                    data-dismiss="modal"
                    style={{ float: "left" }}
                  >
                    إغلاق
                  </button>
                </div>
              </div>
            ) : (
              ""
            )}
          </div>
        </div>
        {/* Argon MODEL */}
      </body>
    </>
  );
}

export default ProtectRoute(Users);
